
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Charmers Checkout</title>
  <script src="https://js.stripe.com/v3/"></script>

  <style>
    body { font-family: Arial, sans-serif; background: #111; color: #fff; margin: 0; padding: 0; }
    .container { display: grid; grid-template-columns: repeat(auto-fit,minmax(300px,1fr)); gap: 20px; padding: 20px; }
    .card { background: #222; border-radius: 10px; padding: 15px; text-align: center; }
    .card img { max-width: 100%; border-radius: 8px; }
    .btn { display: inline-block; margin: 10px; padding: 10px 20px; border: none; border-radius: 5px; cursor: pointer; }
    .add { background: #444; color: #fff; }
    .buy { background: magenta; color: #fff; }
    #cart, #checkout { background:#222; margin:20px; padding:20px; border-radius:10px; }
    input, select { width:100%; padding:10px; margin:5px 0; border-radius:5px; border:none; }
    label { display:block; margin-top:10px; }
    #payment-element { margin-top:20px; }
    #completeOrder { background:limegreen; color:#fff; padding:15px; border:none; border-radius:5px; margin-top:20px; cursor:pointer; }
  </style>
</head>

      <label><input type="checkbox" id="tos"> By buying from Charmers you agree to our ToS</label>
      <div class="g-recaptcha" data-sitekey="6LeT6JArAAAAAKZDUSTu8Krw6i1sQshZnbgMoLvO"></div>

      <button id="completeOrder">Complete Order</button>
    </form>
  </div>

<script>
let cart = [];
function addToCart(name) {
  cart.push(name);
  renderCart();
}
function buyNow(name) {
  cart = [name];
  renderCart();
  document.getElementById('checkout').scrollIntoView();
}
function renderCart() {
  let items = document.getElementById('cartItems');
  items.innerHTML = "";
  cart.forEach(p => {
    let li = document.createElement('li');
    li.textContent = p;
    items.appendChild(li);
  });
  document.getElementById('cartTotal').textContent = (cart.length*10).toFixed(2);
}

const stripe = Stripe("pk_live_51ReQgoHwN7YkNv6zwRaz8N1GO0PL7Bb3pqUbcxhss5cQQpJFKjoiNJR4DWKeTRWwhw2tmejOtXjbnrIg6sHnhxc600ePIEIgBc");
let elements;

initialize();
document.getElementById("payment-form").addEventListener("submit", handleSubmit);

async function initialize() {
  const response = await fetch("https://charmerspay.onrender.com/create-payment-intent", {
    method: "POST",
    headers: { "Content-Type": "application/json" },
    body: JSON.stringify({ items: cart })
  });
  const { clientSecret } = await response.json();

  elements = stripe.elements({ clientSecret });
  const paymentElement = elements.create("payment");
  paymentElement.mount("#payment-element");
}

async function handleSubmit(e) {
  e.preventDefault();
  if(!document.getElementById("tos").checked) {
    alert("You must accept ToS");
    return;
  }
  if (grecaptcha.getResponse().length === 0) {
    alert("Please complete the reCAPTCHA");
    return;
  }
  const { error } = await stripe.confirmPayment({
    elements,
    confirmParams: {
      return_url: window.location.href
    }
  });
  if (error) {
    alert(error.message);
  } else {
    alert(" Payment processed successfully!");
  }
}
</script>
</body>
</html>
